import React, { Component } from "react";
import { Form, Input } from "semantic-ui-react";
import Layout from "../../components/Layout";

class newRecord extends Component {
  render() {
    return (
      <Layout>
        <Form>
          <Form.Field>
            <label>name</label>
            <Input placeholder="enter your name" />
          </Form.Field>
        </Form>
      </Layout>
    );
  }
}

export default newRecord;
